import collections
import re
import numpy as np
class Solution:
    def find_anagrams(self, s: str, p: str) -> list():
        s_len = len(s)
        p_len = len(p)
        if p == s:
            return [0]   
        index = []
        sorted_p = sorted(p)
        for i in range(s_len):
            if (s_len-i) < p_len:
                break
            seq = s[i:(p_len+i)]
            if sorted(seq)==sorted_p:
                index.append(i)
        return index


if __name__ == "__main__":
    a  = Solution()
    s = ""
    p = ""
    
    print(len(s))
    print(a.find_anagrams(s,p))
    